import "./index.css";

const apiKey = "J0BuX1MIuj3hEY2ESEJuiPH5iXCdpLkY";

const peticionAPI = fetch(
  `https://pokeapi.co/api/v2/pokemon-form/${Math.floor(Math.random() * 800)}/`
);

peticionAPI
  .then((respuesta) => respuesta.json())
  .then(({ data }) => {
    const { url } = data.images.original;
    console.log(url);
  });
